import {
  AppBar,
  Toolbar,
  Button,
  Typography,
  makeStyles,
  Grid,
  Box,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  title: {
    flexGrow: 1,
  },
}));

const Header = () => {
  const classes = useStyles();

  return (
    <AppBar position="sticky">
      <Toolbar>
        <Grid container>
          <Grid item lg={1}></Grid>

          <Grid item lg={5}>
            <Typography variant="h4" className={classes.title}>
              Tracthon
            </Typography>
          </Grid>

          <Grid item lg={5}>
            <Box align="right">
              <Button edge="end" color="inherit">
                Login
              </Button>

              <Button edge="right" color="inherit">
                Personal Assistance
              </Button>

              <Button edge="right" color="inherit">
                Login
              </Button>

              <Button edge="right" color="inherit">
                Login
              </Button>
            </Box>
          </Grid>

          <Grid item lg={1}></Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
